import Hero from "./components/Hero";
import DarkButton from "../../shared/DarkButton";

const GetStarted = () => {
  return (
    <div className="get-started">
      <Hero />
      <h1>Create, Join and Discover new people around you</h1>
      <p>
        Solution for every passionate people to find friends with same passion
        in the world
      </p>
      <DarkButton children="Get Started" />
    </div>
  );
};

export default GetStarted;
